import React from 'react';

export default () => {

    return (
        <div>
            <div class="row">
                <h1 id="eat-title">?</h1>
            </div>
            <div class="row">
                <p>

                <h1 id="eat-title">?</h1>
                </p>
                <button type="button" class="btn btn-sm btn-outline-primary">今天晚上吃什麼?</button>
            </div>
            <div class="row">
                <ul class="list-group">
                    <li class="list-group-item">拉麵</li>
                    <li class="list-group-item">滷肉飯</li>
                    <li class="list-group-item">水餃</li>
                </ul>
            </div>
            <button onClick={eat}>Eat</button>;
        </div>
    )



    function eat() {
        alert('s');
    }

};
